import React from "react";

const LiveStats = () => {
  return (
    <div>
      <div
        class="card text-white bg-primary mb-3"
        style={{ maxWidth: "20rem" }}
      >
        <div class="card-header">
          Confirmed<span class="badge badge-danger ml-2">17,586</span>{" "}
          <i class="fas fa-long-arrow-alt-up cc_pointer justify-content-end"></i>{" "}
          <span class=" ml-2 d-flex d-inline justify-content-end">545</span>
        </div>
        <div class="card-body">
          <h5 class="card-title">Primary Panel title</h5>
          <p class="card-text text-white">
            Some quick example text to build on the panel title and make up the
            bulk of the panel's content.
          </p>
        </div>
      </div>
    </div>
  );
};

export default LiveStats;
